import React from 'react';
import './Contract.css';

function Contract() {
  return (
    <div className="contract">
      <h2>Make a Contract</h2>
      <form>
        <label htmlFor="contractTitle">Contract Title:</label>
        <input type="text" id="contractTitle" name="contractTitle" required />

        <label htmlFor="contractDetails">Contract Details:</label>
        <textarea id="contractDetails" name="contractDetails" required></textarea>

        <button type="submit">Submit Contract</button>
      </form>

      <h2>Review Previous Contracts</h2>
      <ul>
        <li>Contract 1</li>
        <li>Contract 2</li>
        <li>Contract 3</li>
      </ul>
    </div>
  );
}

export default Contract;
